import React, { useState, useEffect } from "react";


const UsersList = () => {
    useEffect(() => {
        async function getUsers(){
            try {
                const data = fetch('/api/v2/users', {
                    headers: {
                      Authorization: token,
                    }
                  })
            }
            catch (ex) {
                console.log(ex);
            }
        }
        getUsers();
    }, [])

    useEffect(() => {
        async function getPackages() {
          try {
            setSpinning(true);
            const data = await packageService.getPackages();
            let packages = data.map(p => {
              p.key = p.packageId
              return p;
            });
            setPackageData(packages);
            setSpinning(false);
          } catch (ex) {
            setSpinning(false);
          }
        }
        getPackages();
      }, []);

}


export default UsersList;
